import Header from "../Components/header";
import Button from '@material-ui/core/Button';
const Splash = function(){
    return <div>
        <Header></Header>
        <div class="buttons">
        <Button children="Signin" color="default" size="large" variant="contained"></Button><br></br>
        <Button children="Signup" color="default" size="large" variant="contained"></Button>
        </div>
    </div>
}
export default Splash
